import React from 'react'


import Styled from 'styled-components'
const Sidebar=()=> {
  return (
    <SidebarContainer>
        <Menu>
            <a >
                <h2>Dashboard</h2>
            </a>
            <a>
                Clients
            </a>
            <a>
                Bodyguard
            </a>
            <a>
                Team
            </a>
            <a>
                Settings
            </a>
            <a>
                Another
            </a>
            
        </Menu>
        <Logout>
              Logout
        </Logout>

    </SidebarContainer>
  )
}

export default Sidebar;

const SidebarContainer = Styled.div`
    display:flex;
    flex-direction: column;
    justify-content: flex-end;
    position:relative;
    background:green;
    width:250px;
    
    left:0;
    bottom:0;


`
const Menu = Styled.div`
display:flex;
justify-content:space-between;
align-items:center;
flex-direction:column;


`
const Logout = Styled.div`
position:absolute;
bottom:0;
font-weight:400;


`
